// 创建路由
import VueRouter from 'vue-router'
// 引入组件
import Login from '../views/admin/Login'
import Index from '../views/admin/Index'
import User from '../views/admin/user/User'
import Tagg from '../views/'
export default new VueRouter({
    routes: [
        {
            path:'/login',
            name:'login',
            component:Login
        },
        {
            path:'/index',
            name:'index',
            component:Index,
            children:[
                {
                    path:'/user',
                    name:'user',
                    component:User
                },
                {
                    path:'/tag',
                    name:'tag',
                    component:Tagg
                },
            ]
        },

    ]
})
